import styled from "styled-components";
import { Link } from 'react-router-dom';
const Container = styled.div`
  width: 200px;
  height: 600px;
  margin-top: 10px;
  margin-left: 5px;
  border-radius: 20px;
  border: 0.1px solid #eff0eb;
  box-shadow: 0 0.375rem 0.75rem rgba(140, 152, 164, 0.075);
`;

const Category = styled.div`
  width: 178.6px;
  height: 37px;
  color: #132144;
  margin: 0px 0px 4px;
  padding: 8px 14px;
  font-size: 13px;
  text-align: center;
  font-weight: 400;

  &:hover {
    color: #6e6e6e;
    cursor: pointer;
  }
`;

const TitleName = styled.div`
  width: 178.6px;
  height: 37px;
  color: #ffd43b;
  margin: 0px 0px 4px;
  padding: 8px 14px;
  font-size: 13px;
  text-align: center;
  font-weight: 600;
`;

const LinkTag = styled(Link)`
    text-decoration: none;
    color: #132144;
    &:hover {
    color: #6e6e6e;
    cursor: pointer;
  }
`

const Sidebar = ({text}) => {
  return (
    <>
      <Container>
        <TitleName>워킹홀리데이</TitleName>
        <Category>
        <LinkTag to='/CommunityPage'>
            커뮤니티
          </LinkTag>
        </Category>
        <Category>국가 정보</Category>
        <Category>
        <LinkTag to='/Review'>
            국가별 후기
          </LinkTag>
        </Category>
        <Category>출국 전 정보</Category>
        <Category>도착 후 해외 생활 정보</Category>
        <Category>귀국 후 정보</Category>
        <Category>
          <LinkTag to='/GroupBuying'>
            물품 공동구매
          </LinkTag>
        </Category>
      </Container>
    </>
  );
};

export default Sidebar;
